import React, { useContext, useState, useEffect } from 'react';

import Login from '../Login/Login';
import Card from '../UI/Card/Card';
import classes from './Home.module.css';
import homeImage from '../../assets/formula.jfif';
import Guest from './Guest';
import AuthContext from '../../store/auth-context';

const Home = (props) => {

  const ctx = useContext(AuthContext);

  const [formCheck, setFormCheck] = useState();

  const checkForm = props.openLogin;

  useEffect(() => {
    setFormCheck(checkForm);
    
    return () => {
      setFormCheck(false);

    }
  }, []);

  return (
    <React.Fragment>
      <div className={classes.background}>
        <img src={homeImage} alt="Formula" className={classes.img} />
      </div>
      <Card className={classes.home}>{formCheck && <Login />}
      {!ctx.isLoggedIn && <Guest />}</Card>
    </React.Fragment>
  );
};

export default Home;
